import "./style/General.css"

import NavBar from "./NavBar";

const GymnasticsPage = () => {
    return (
        <div className="page">
            <NavBar />

            <div className="content">
                {/* Header */}
                <div id="gymnastics-header">
                    <h1> GYMNATICS </h1>
                    <h2> Brown University </h2>
                    <h2> Women's Gymnastics </h2>
                </div>
            </div>
        </div>
    )
}

export default GymnasticsPage;
